(a) Owner or Tenant shall from time to time, within ten (10) days after receipt of the other party's written request therefor, deliver a written statement addressed to the requesting party and/or to any Financing Entity (as specified by Tenant) (each an “Estoppel Certificate”) certifying all or some of the below:

(i) That the Agreement is unmodified and in full force and effect (or if modified, a brief description of such modification and that this Agreement as so modified is in full force and effect);

(ii) That the Agreement attached to the Estoppel Certificate is a true and correct copy of this Agreement, and all amendments hereto, and constitutes the entire agreement between Owner and Tenant relating to the Solar Facility;

(iii) That to the knowledge of Owner, Tenant has not previously assigned or hypothecated its rights or interests under this Agreement, except as described in such Estoppel Certificate with as much specificity as Owner is able to provide;

(iv) The term of this Agreement and the Annual Rent then in effect and any additional charges pursuant to this Lease;

(v) The date through which Tenant has paid the Rent;

(vi) Neither party to the Agreement is in default nor has either breached the Agreement and, to the best of Owner's knowledge, no facts or circumstances exist which, with the passage of time or the giving of notice or both, would constitute a default or breach by either such party under this Agreement;

(vii) There are no actions pending against Owner under the bankruptcy or any similar laws of the United States or any state;

(viii) Owner is not aware of any event, act, circumstance or condition constituting a Force Majeure Event under the Agreement (“Force Majeure Event” meaning, in relation to a Party, any act, event or circumstance, to the extent to which the cause of such act, event or circumstance is not of such Party's making nor within that Party's reasonable control, including without limitation, acts of God, natural disasters or catastrophic events such as epidemics, pandemics, nuclear accidents, fire, flood, typhoons or earthquakes, war, civil disturbances, insurrections, accidents, damage to its facilities, labor disputes, embargos, acts of any governmental body not attributable to such Party's failure to comply with this Agreement);

(ix) Owner has not paid any amounts or received any claims under the indemnification provisions in the Agreement;

(x) Tenant does not owe any indemnity payments to Owner and Owner has no existing counterclaims, offsets or defenses against Tenant under the Agreement;

(xi) There are no proceedings pending or, to Owner's knowledge, threatened against or affecting Owner in any court or by or before any court, governmental authority or arbitration board or tribunal which could reasonably be expected to have a material adverse effect on the ability of Owner to perform its obligations under the Agreement;

(xii) There are no disputes or proceedings between Owner and Tenant related to the Agreement;

(xiii) The assignment of certain direct or indirect equity interests in Tenant to the Financing Entity will not violate the terms and conditions of the Agreement, and any related consent or notice to Owner under the Agreement is hereby deemed satisfied;

(xiv) Owner agrees (i) to provide notice of any default by Tenant under the Agreement to Financing Entity at an address provided to Owner by Tenant and (ii) such Financing Entity is a Financing Entity pursuant to Section 18 of the Agreement; and

(xv) Such other matters as are reasonably requested by Tenant or its Financing Entities
